import React, { useState, useEffect } from 'react';
import { motion } from 'framer-motion';

const HeroMultimediaSection = ({ goToSlide }) => {
  const [currentImageIndex, setCurrentImageIndex] = useState(0);

  // Datos del carrusel
  const carouselImages = [
    {
      id: 1,
      src: 'https://via.placeholder.com/600x400/3b82f6/ffffff?text=XR+Code+Visualization',
      caption: 'Experience your code in immersive 3D environments with real-time interaction.',
      title: 'Immersive Code Exploration'
    },
    {
      id: 2,
      src: 'https://via.placeholder.com/600x400/06b6d4/ffffff?text=3D+Metrics+View',
      caption: 'Visualize complexity metrics through dynamic 3D representations.',
      title: '3D Metrics Visualization'
    },
    {
      id: 3,
      src: 'https://via.placeholder.com/600x400/10b981/ffffff?text=AR+Code+Analysis',
      caption: 'Analyze code quality with augmented reality overlays and insights.',
      title: 'Augmented Reality Analysis'
    }
  ];

  // Carrusel automÃ¡tico
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prev) => (prev + 1) % carouselImages.length);
    }, 4000);

    return () => clearInterval(interval);
  }, [carouselImages.length]);

  const goToImage = (index) => {
    setCurrentImageIndex(index);
  };

  const nextImage = () => {
    setCurrentImageIndex((prev) => (prev + 1) % carouselImages.length);
  };

  const prevImage = () => {
    setCurrentImageIndex((prev) => 
      prev === 0 ? carouselImages.length - 1 : prev - 1
    );
  };

  return (
    <div className="slide hero-multimedia-slide" id="multimedia">
      <div className="hero-multimedia-container">
        <motion.div 
          className="hero-multimedia-header"
          initial={{ opacity: 0, y: 30 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
        >
          <h2 className="section-title">
            <span className="brand">Experience</span> Code in XR
          </h2>
          <p className="hero-subtitle">
            Immerse yourself in your code with cutting-edge visualizations
          </p>
        </motion.div>

        <div className="multimedia-content-grid">
          {/* Video Section */}
          <motion.div 
            className="video-section-hero"
            initial={{ opacity: 0, x: -30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <h3 className="multimedia-section-title">
              <span className="section-icon">ð¥</span>
              Live Demo
            </h3>
            <div className="video-wrapper-hero">
              <div className="video-placeholder">
                <div className="video-placeholder-content">
                  <div className="play-button">
                    <span>â¶</span>
                  </div>
                  <h4>Interactive XR Demo</h4>
                  <p>See Code-XR in action with real VS Code projects</p>
                  <span className="video-badge">Coming Soon</span>
                </div>
              </div>
            </div>
          </motion.div>

          {/* Carousel Section */}
          <motion.div 
            className="carousel-section-hero"
            initial={{ opacity: 0, x: 30 }}
            animate={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
          >
            <h3 className="multimedia-section-title">
              <span className="section-icon">ð¼ï¸</span>
              Visual Gallery
            </h3>
            <div className="carousel-wrapper-hero">
              <button 
                className="carousel-nav prev"
                onClick={prevImage}
                aria-label="Previous image"
              >
                â¹
              </button>

              <div className="carousel-content-hero">
                <div className="carousel-slide-hero">
                  <div className="carousel-image-wrapper-hero">
                    <img 
                      src={carouselImages[currentImageIndex].src}
                      alt={carouselImages[currentImageIndex].title}
                      className="carousel-image"
                    />
                    <div className="image-overlay">
                      <h4>{carouselImages[currentImageIndex].title}</h4>
                    </div>
                  </div>
                  <div className="carousel-caption-hero">
                    <p>{carouselImages[currentImageIndex].caption}</p>
                  </div>
                </div>
              </div>

              <button 
                className="carousel-nav next"
                onClick={nextImage}
                aria-label="Next image"
              >
                âº
              </button>
            </div>

            <div className="carousel-indicators">
              {carouselImages.map((_, index) => (
                <button
                  key={index}
                  className={`indicator ${index === currentImageIndex ? 'active' : ''}`}
                  onClick={() => goToImage(index)}
                  aria-label={`Go to image ${index + 1}`}
                />
              ))}
            </div>
          </motion.div>
        </div>
      </div>

      {/* Next Section Arrow */}
      <div 
        className="next-section-arrow" 
        onClick={() => goToSlide(2)}
      >
        <div className="arrow-icon">â</div>
      </div>
    </div>
  );
};

export default HeroMultimediaSection;
